import React,{Component} from "react";
import '../css/PlayStoreStats.css'
import activeUsersIcon from '../'

class PlayStoreStats extends Component{
    render(){
        return(
            <div className="container">
                <div className="row">
                    <div className="col-lg-3 col-md-3">
                        <div className="stat">
                            <img className="statLogo"></img>
                            <div className="statText">
                                <p className="statTitle"></p>
                                <p className="statDescription"></p>
                            </div>
                        </div>
                    </div>
                    <div className="col-lg-3 col-md-3">

                    </div>
                    <div className="col-lg-3 col-md-3">

                    </div>
                    <div className="col-lg-3 col-md-3">

                    </div>
                </div>
            </div>
        );
    }
}

export default PlayStoreStats;
